.
🏰 Херсонес Таврический. 
.
Музей в Севастополе. Представленные здесь мозаики, амфоры для вина, предметы быта помогут понять, как жили херсонеситы.
.
🏔 Гора Ай-Петри. 
.
Живописное место, откуда открываются потрясающие виды крымской природы. После тура в солнечный Крым у вас будет много ярких воспоминаний.
.
🕌 Ливадийский дворец. 
.
Интересная достопримечательность с красивой архитектурой. Здесь состоялась знаменитая Ялтинская конференция.
.
💦 Водопад Джур-Джур. 
.
Переводится как «Вечно журчащий». Высота — 15 м. Считается, что даже в засуху водопад остается полноводным.
.
🔮 Мраморная пещера. 
.
По красоте не уступает пещерам Европы. Кристаллы, сталактиты и сталагмиты поражают разнообразием.
.
🌸 Ласточкино гнездо. 
.
Визитная карточка Крыма. Архитектура дворца напоминает эпоху Средневековья. Он и в самом деле похож на гнездо ласточки, поскольку расположен на скале. В дополнение ко всему отсюда открывается живописный вид.
.
⛲️ Бахчисарайский фонтан. 
.
По преданию, жестокий хан Крым Гирей полюбил девушку-рабыню Диляру. Когда она умерла, хан приказал построить из камня фонтан. Это было прообразом чувств Гирея: из камня лились слезы. Поэтому фонтан еще называют «фонтаном слез».
.
🌈 Лавандовые поля. 
.
Место завораживающей красоты и эстетического наслаждения. Красочные фотографии будут напоминать о летних деньках в Крыму.
.
💎 Мыс Фиолент. 
.
Гроты, пещеры, реликтовые деревья, природные ванны. Миллионы лет назад здесь бушевал вулкан. На берегу еще видна застывшая лава. 
.
